import React from 'react';

import styles from './../Style/Components/Server.module.css';

type MyProps = { Name: string, id: number, Selected: boolean };
type MyState = { Picture: string, Active: boolean };
class Server extends React.Component<MyProps, MyState> {
  public state: MyState;

  constructor(props) {
    super(props);
    this.state = {
      Picture: `${process.env.Storage_Url}/Servers/UUw40MdRDcUxdEy00Zuo/Icon`,
      Active: true
    };

    this.handleClick = this.handleClick.bind(this);
  }

  handleClick() {
    this.setState(state => ({
      Active: !state.Active
    }));

  }
  render() {
    return (
      <div role="button" className={styles.Container} onClick={this.handleClick}>
        <div className={styles.Active}></div>
        <picture className={styles.Icon}>
          <img className={styles.Icon_IMG} src={this.state.Picture} />
        </picture>
      </div>
    );
  }
}

export default Server;
